import React from 'react';
//import './index.css';
import Card from './Card';
import CardData from './CardInfo';


function MyApp() {
  return (
    <>
      <h1 className="heading_style">List of Top 6 Netflix Shows: Yuva React App</h1>
      {CardData.map((item)=>{
        return (
          <Card
            src={item.mySrc}
            link={item.myLink}
            category={item.myCategory}
            title={item.myTitle}
          />
          
        );
      })} 
    
    </>
  )}

export default MyApp;
